import React from 'react'

export default function Nav() {
    return (
        <div>
            <nav className="nav flex-column">
                <a className="nav-link active" aria-current="page" href="gdsgsd">Active</a>
                <a className="nav-link" href="#gdsg">Link</a>
                <a className="nav-link" href="#gsd">Link</a>
                <a className="nav-link disabled" href="#gsd" tabIndex={-1} aria-disabled="true">Disabled</a>
            </nav>
        </div>
    )
}
